import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import "./App.css";


const Room = () => {
    const navigate = useNavigate()
    const [closeButton, setCloseButton] = useState("Выйти");

    if (localStorage.getItem("status") === "admin") {
        setCloseButton("Завершить конференцию");
    }

    const GoToBack = () => {
        navigate(-1)
    }


  return (
    <div className="Room">
      <div className="header-box">
        <div className="header-text">
          Конференция
        </div>
      </div>
          <div>
              <button onClick={GoToBack}>{closeButton}</button>
          </div>
          <div className=""></div>
    </div>
  );
};

export default Room;
